import React from 'react';
import s from './css/Choise.module.css'


const Choise = () => {
  return (
    <div className={s.toggle}>
      <input type="radio" name="sizeBy" value="weight" id="sizeWeight" />
      <label for="sizeWeight">It's pretty, pretty, pretty, pretty good</label>
      <input type="radio" name="sizeBy" value="dimensions" id="sizeDimensions" checked="checked" />
      <label for="sizeDimensions">100% yes</label>
    </div>);

}
export default Choise;
